import { createSlice } from '@reduxjs/toolkit'
export const ap= createSlice({
    initialState:810,
    name:"ap",
    reducers:{
        WITH_DROW_MONAY:(state,action)=>{
            return state+action.payload
        },
        WITH_DIPOSED_MONAY:(state,action)=>{
            return state-action.payload


        }
    }

})
export const {WITH_DROW_MONAY,WITH_DIPOSED_MONAY}=ap.actions
export default ap.reducer
